import React from "react";

export function Img () {
	catImg = () => {fetch('https://api.thecatapi.com/v1/images/search')
	.then(function(res) {
			console.log(res)
			return res.json();
	})
	.then((data) => {
			console.log(data[0].url)
			return data[0].url;
	})}

	return(
	<section>
		<img src ={catImg} ></img>
	</section>
	)
}

export default Img;
